double *rdbuf,*pbuf;
void generate_pluck(double f,int t,int wavetable_id,double fct)
{
	static int size;
	size=int(44100/f);
	rdbuf=new double[size];
	pbuf=new double[t];
	for(int i=0;i<size;i++)
		rdbuf[i]=table[wavetable_id][((long long)(c*i*f)%3294198+3294198)%3294198];
	pbuf[0]=rdbuf[0];
	for(int i=1;i<t;i++)
	{
		rdbuf[i%size]=(rdbuf[i%size]+fct*rdbuf[(i+size-1)%size])/(fct+1);
		pbuf[i]=rdbuf[i%size];
	}
}
inline double get_pluck(int t)
{
	return pbuf[t];
}
inline double fast_bass_l(double n,double t,double e,double gt)
{
	return get_pluck(n)*(1+sin(gt/bass_lfo_div)*bass_lfo_amp)*(tanh(0.025*t-5)+1)*(tanh(0.025*e-5)+1)/4;
}
inline double fast_bass_r(double n,double t,double e,double gt)
{
	return get_pluck(n)*(1-sin(gt/bass_lfo_div)*bass_lfo_amp)*(tanh(0.025*t-5)+1)*(tanh(0.025*e-5)+1)/4;
}
double real_rand()
{
	static random_device rd;
	static mt19937_64 r(rd());
	static uniform_real_distribution<double> dis;
	return dis(r);
}
double cymbal(double t)
{
	return real_rand()/(1+t/1920);
}
double drum(double t,double f,double e)
{
	return (real_rand()/(1+t/70)+sin(pi/44100*t*f/(1+t/5000)*2))/(1+t/2000)*(tanh(0.1*e-5)+1)/2;
}
double snare(double t,double f,double e)
{
	return cymbal(t)/2+drum(t,f/5,e)/2;
}
